var tipuesearch = {"pages": [{'title': 'About', 'text': 'https://github.com/51133116/51133116.github.io \n https://51133116.github.io \n https://github.com/mdecycu/cmsimde \n \n', 'tags': '', 'url': 'About.html'}, {'title': '網站設定', 'text': '如何利用指令設定winows系統的代理主機,開啟IPv6網路協定? \n \n 要設定  Windows  系統的代理主機，可以按照以下步驟進行操作：  1.  開啟「設定」應用程式，選擇「網路和網際網路」。  2.  選擇「代理」選項卡。  3.  在「手動設定代理伺服器」下，打開「使用代理伺服器」開關。  4.  輸入代理伺服器的  IP  位址和埠號。  5.  選擇要在代理伺服器上使用的代理類型，例如  HTTP  或  SOCKS 。 至於要開啟  IPv6  網路協定，可以按照以下步驟進行操作：  1.  開啟「控制台」。  2.  選擇「網路和網際網路」。  3.  選擇「網路和共用中心」。  4.  選擇正在使用的網路連線，然後點擊「屬性」。  5.  找到「 Internet  協定版本  6 (TCP/IPv6) 」，勾選該選項，然後點擊「確定」。 這樣就完成了  Windows  系統的代理主機設定和  IPv6  網路協定的開啟。 \n', 'tags': '', 'url': '網站設定.html'}, {'title': 'wink', 'text': 'Wink - [Homepage] (debugmode.com) \n \n \n', 'tags': '', 'url': 'wink.html'}]};